import React, { Component } from "react";

class Navbar extends Component {
  state = {
    forma: "nav-bar-circulo fixed-top"
  };
  handlerNav = e => {
    e.preventDefault();
    const largo = "nav-bar fixed-top";
    this.setState({ forma: largo });
  };
  render() {
    return (
      <div className={this.state.forma} onMouseOver={this.handlerNav}>
        <div className="nbc"></div>
        <h5>Who i am</h5>
        <h5>Skills</h5>
        <h5>Studies</h5>
        <h5>Contact me</h5>
      </div>
    );
  }
}

export default Navbar;
